import React, { Component } from "react";
import { Link } from "react-router-dom";
import SideNavigation from "./SideNavigation";

class HeaderLeft extends Component {
  render() {
    var { toggleNav } = this.props;
    console.log(toggleNav);
    return (
      <div className="col header-left p-0">
        <ul className="nav d-flex d-xl-none">
          <li className="nav-item">
            <button
              onClick={() => this.props.onToggleNav()}
              className="btn shadow-none far fa-bars size-18"
            ></button>
          </li>
          <li className="nav-item">
            <img src="https://vn.aorus.com/img/AORUS_logo.png" alt="" />
          </li>
        </ul>
        <SideNavigation toggleNav={toggleNav} />
        <ul
          className={
            toggleNav
              ? "nav menu margin-left align-items-center d-xl-flex d-none"
              : "nav menu align-items-center d-xl-flex d-none"
          }
        >
          <li className="nav-item">
            <button
              onClick={() => this.props.onToggleNav()}
              className="btn shadow-none far fa-bars size-18"
            ></button>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin/users">
              Users
            </Link>
          </li>
          <li className="nav-item">
            <Link className="text-decoration-none" to="/admin">
              Settings
            </Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default HeaderLeft;
